        <div className="card_image">
            <img src={computer} alt="computer"/>

           

        </div>
        <h3>Online Course Facilities</h3>
        <p>Access a world of knowledge from the comfort of your home with our online course facilities.</p>


        </div>

        </div>

    )
}

